column1:
The Smiling Buddha is a yummy salad! If you're looking to make it healthy try: requesting the chicken to be cooked using butter or extra virgin olive oil only; 
Subbing fresh avocado for dried fruit; Dressing on the side; 
Sea salt and pepper are a great addition. More details: http:\/\/is.gd\/BZMxv6

